import Theme from '../styles/theme'

function Navigation() {

    return (
        <div id="nav">
            <h1 id="title">Synapse Flash</h1>
            <style jsx>{`
                #nav {
                    position: fixed;
                    top: 0;
                    left: 0;
                    width: 100%;
                    height: 100px;
                    background: white;
                    z-index: 99;
                    box-shadow: ${Theme.sh.mat};
                }
                #title {
                    float: left;
                    font: 18px ${Theme.font.title};
                }
            `}</style>
        </div>
    )
}

function Layout({children}) {
    return (
        <div id='layout'>
            <Navigation></Navigation>
            {children}
            <style jsx global>{`
                #__next {
                    padding: 0;
                    margin: 0;
                }
                body {
                    padding: 0;
                    margin: 0;
                    width: 100%;
                    height: 100%;
                    margin-top: 100px;
                }
            `}</style>
        </div>
    )
}

export default Layout
